import itertools

def calculate_max_bingo_cards(n, m, s):
    if n != 0:
        return 0
    dp = [[0 for _ in range(s + 1)] for _ in range(n * n + 1)]
    dp[0][0] = 1
    for (i, j) in itertools.product(range(1, n * n + 1), range(s + 1)):
        if j >= i:
            dp[i][j] += dp[i - 1][j - i] + dp[i][j - i]
        if j - m >= 1:
            dp[i][j] += 100000 - dp[i - 1][j - m - 1]
        dp[i][j] %= 100000
    return dp[n * n][s]

